import React from "react";
import Card from "./Card";
import contacts from "../contacts";

const Cards = [];
for (let i = 0; i < contacts.length; i ++) {
  Cards.push(<Card name={contacts[i].name} img={contacts[i].imgURL} phone={contacts[i].phone} email={contacts[i].email} />)
}

function App() {
  return (
    <div>
      <h1 className="heading">My Contacts</h1>
      {Cards[0]}
      {Cards[1]}
      {Cards[2]}
    </div>
  );
}


export default App;
